var sounds;

/*
  edit_start   : "",
  edit_end     : "",
  drag_start   : "",
  drag_end     : "",
  dialog_open  : "",
  dialog_close : ""
*/
chrome.storage.local.get({
  dialog_close  : "data:audio/ogg;base64,",
  dialog_open   : "data:audio/ogg;base64,",
  drag_end      : "data:audio/ogg;base64,",
  drag_start    : "data:audio/ogg;base64,",
  edit_end      : "data:audio/wav;base64,",
  edit_start    : "data:audio/wav;base64,"
  }, function(items) {
    sounds = items;
  });


var MutationObserver = window.MutationObserver || window.WebKitMutationObserver || window.MozMutationObserver;

/*--------------------------------------------------------------*/
var is_dragging = false;
var editing = false;
var observer = new MutationObserver(function() {

  if (document.querySelectorAll('.ui-sortable-helper').length > 0 && !is_dragging) {
    is_dragging = true;
    //console.log('dragging!');
    play_sound('drag_start');
  }
  if (document.querySelectorAll('.ui-sortable-helper').length === 0 && is_dragging) {
    is_dragging = false;
    //console.log('not dragging!');
    play_sound('drag_end');
  }

  if ((document.querySelectorAll('.editing,.focus').length > 0 || document.querySelectorAll('.card-composer.hide').length === 0) && !editing) {
    editing = true;
    //console.log('editing!');
    play_sound('edit_start');
  }

  if ((document.querySelectorAll('.editing,.focus').length === 0 && document.querySelectorAll('.card-composer.hide').length > 0) && editing) {
    editing = false;
    //console.log('not editing!');
    play_sound('edit_end');
  }
});

observer.observe(document.querySelector('body'), {
  childList: true,
  subtree: true,
  attributes: true,
  attributeFilter: ["style"]
});
/*--------------------------------------------------------------*/
var window_open = false;


var dialog_effects = function() {

  if (is_visible('.window') && !window_open) {
    window_open = true;
    //console.log('window!');
    play_sound('dialog_open');
  }
  if (!is_visible('.window') && window_open) {
    window_open = false;
    //console.log('not window!');
    play_sound('dialog_close');
   }
}

var observer = new MutationObserver(dialog_effects);
observer.observe(document.querySelector('.window'), {
  attributes: true,
  attributeFilter: ["style"]
});

/*--------------------------------------------------------------*/

/* this function is too simplistic to be a replacement for jQuery's :visible, but it does the job here. */
function is_visible(selector) {
  var elements = document.querySelectorAll(selector),
      has_visible = false;

  //console.log('checking is_visible with selector', selector, '=', elements.length);

  [].forEach.call(elements, function (element) {
    if (element.style['display'] !== 'none') {
      has_visible = true;
    }
  });
  return has_visible;
}

function play_sound(soundname) {
  //nsole.log('playing', soundname);

  soundfile = sounds[soundname];

  if (document.querySelectorAll('#soundplayer').length == 0) {
    var soundPlayer = document.createElement('div');
    soundPlayer.setAttribute('id', 'soundplayer');
    soundPlayer.style['display'] = "none";
    document.querySelector('body').appendChild(soundPlayer);
  }

  document.getElementById('soundplayer').innerHTML = '<audio autoplay src="'+soundfile+'"></audio>';
}
